// @flow

import GeoUtils from "../../src/geo/geoUtils";

describe("Test the Utils functions", () => {

	test("getPointInPolygonInfo idmunidistri should return 08184600", async () => {

		const dades = await loadData();
		const feature = await GeoUtils.getPointInPolygonInfo([2, 41.5], dades);
		expect(feature).not.toBeNull();
		expect(feature.properties.idmunidistri).toBe("08184600");

	});

	test("toMercatorBbox should return a bbox", async () => {

		const bboxRect = [
			[
				[ 221970.6384388141, 5085705.329339559 ],
				[ 223307.32473428015, 5085705.329339559 ],
				[ 223307.32473428015, 5087042.015640694 ],
				[ 221970.6384388141, 5087042.015640694 ],
				[ 221970.6384388141, 5085705.329339559 ]
			]
		];
		const bbox = await GeoUtils.toMercatorBbox([2, 41.5]);
		expect(bbox).not.toBeNull();
		expect(bbox.geometry.coordinates).toEqual(bboxRect);

	});

	test("unionFeatures should return one feature", async () => {

		const dades = await loadData();

		const feature = await GeoUtils.unionFeatures(dades);
		expect(feature).not.toBeNull();

	});

});

